export default function Product({ product }) {

  return (

        <td style={{
              width: "15%",
              padding: "10px",
              boxSizing: "border-box", }}>


      <Link to= {`/product/${product.id}`}><strong>{product.name}</strong> ({product.description}) </Link>

      <img
        src={product.imageUrl}
        alt={product.description}
        style={{
          // display: "block",
          // maxWidth: "100%",
           width: "400px",
          height: "400px",

        }}

      />
      </td>





  );
}
